  "payload_length": {
    "fixed": 20
  },
  "fields": [
    {
      "byte_offset": 0,
      "data_type": "U1",
      "name": "type",
      "description": "Message type (0x05 for this type)",
      "fixed_value": 5
    },
    {
      "byte_offset": 1,
      "data_type": "U1",
      "name": "version",
      "description": "Message version (0x00 for this version)",
      "fixed_value": 0
    },
    {
      "byte_offset": 2,
      "data_type": {
        "array_of": "U1",
        "count": 2
      },
      "name": "reserved0",
      "description": "Reserved",
      "reserved": true
    },
    {
      "byte_offset": 4,
      "data_type": "I4",
      "name": "a0",
      "scale": {
        "raw": "2^-30",
        "multiplier": 9.313225746154785e-10
