      "unit": "s",
      "description": "First parameter of UTC polynomial"
    },
    {
      "byte_offset": 8,
      "data_type": "I4",
      "name": "a1",
      "scale": {
        "raw": "2^-50",
        "multiplier": 8.881784197001252e-16
      },
      "unit": "s/s",
      "description": "Second parameter of UTC polynomial"
    },
    {
      "byte_offset": 12,
      "data_type": "I1",
      "name": "dtLS",
      "unit": "s",
      "description": "Delta time due to current leap seconds"
    },
    {
      "byte_offset": 13,
      "data_type": "U1",
      "name": "tot",
      "scale": {
        "raw": "3600",
        "multiplier": 3600.0
