      "unit": "s",
      "description": "UTC parameters reference time of week (Galileo time)"
    },
    {
      "byte_offset": 14,
      "data_type": "U1",
      "name": "wnt",
      "unit": "weeks",
      "description": "UTC parameters reference week number (the 8-bit WNt field)"
    },
    {
      "byte_offset": 15,
      "data_type": "U1",
      "name": "wnLSF",
      "unit": "weeks",
      "description": "Week number at the end of which the future leap second becomes effective (the 8-bit WNLSF field)"
    },
    {
      "byte_offset": 16,
      "data_type": "U1",
      "name": "dN",
      "unit": "days",
