    },
    {
      "byte_offset": 17,
      "data_type": "I1",
      "name": "dTLSF",
      "unit": "s",
      "description": "Delta time due to future leap seconds"
    },
    {
      "byte_offset": 18,
      "data_type": {
        "array_of": "U1",
